sourcesContent:
import React from 'react';
import Footer from '../components/Footer/Footer';
import AppBar from '../../src/components/appBar/AppBar';
import { Button, Container, Typography, Grid, Box } from '@mui/material';


// const services = [
//   {
//     icon: <FaRobot size={32} />,
//     title: 'Virtual Reality',
//     description: 'Explore and interact with 3D worlds through advanced simulations, opening new possibilities for education, entertainment, and innovation.',
//     link: '#'
//   },
//   {
//     icon: <FaGraduationCap size={32} />,
//     title: 'Virtual Mechatronics',
//     description: 'Virtual Mechatronics is a cutting-edge platform that bridges the physical and digital worlds of engineering.',
//     link: '#'
//   },
//   {
//     icon: <FaPowerOff size={32} />,
//     title: 'Robotic Automation',
//     description: 'Technology that makes it easy to build, deploy, and manage robots that emulate humans actions interacting with digital systems and software.',
//     link: '#'
//   },
//   {
//     icon: <FaBrain size={32} />,
//     title: 'Virtual Design',
//     description: 'Creation of immersive, computer-generated environments for various industries.',
//     link: '#'
//   }
// ];

const MainContent = () => {
  return (
    <>
      {/* About Start */}
      <Container className="py-1">
        <Box className="text-center mx-auto max-w-md wow fadeIn" data-wow-delay="0.1s">
          <Button variant="outlined" color="primary" className="rounded-full px-3 mb-3">
            WORDSKILLS
          </Button>
        </Box>
        <Grid container spacing={5} alignItems="center">
          <Grid item lg={6} className="wow fadeIn" data-wow-delay="0.1s">
            <Box className="overflow-hidden rounded-lg">
              <img className="w-full h-auto" src="img/worldskill/pic1.png" alt="Worldskills" />
            </Box>
          </Grid>
          <Grid item lg={6} className="wow fadeIn" data-wow-delay="0.5s">
            <Typography variant="h1" className="mb-4">Worldskills Competition</Typography>
            <Typography className="mb-4">
              The WorldSkills International competition is the peak vocational skills competition for young people across the world. It was started in Spain in 1950 and is currently in 85 countries all over the world.
            </Typography>
            <Typography className="mb-4">
              On 13th October 2020, WorldSkills Kenya (WSK) was ratified as the 84th state to host skills competitions. Kenya is preparing to participate in the upcoming competition organized by WorldSkills International (WSI).
            </Typography>
            <Grid container spacing={3}>
              <Grid item sm={6}>
                <Typography variant="h6" className="mb-3 flex items-center">
                  {/* <FaCheck className="text-primary mr-2" /> Global Vocational Competition */}
                </Typography>
                <Typography variant="h6" className="mb-0 flex items-center">
                  {/* <FaCheck className="text-primary mr-2" /> WorldSkills Kenya */}
                </Typography>
              </Grid>
              <Grid item sm={6}>
                <Typography variant="h6" className="mb-3 flex items-center">
                  {/* <FaCheck className="text-primary mr-2" /> Tvet Training */}
                </Typography>
                <Typography variant="h6" className="mb-0 flex items-center">
                  {/* <FaCheck className="text-primary mr-2" /> Competent Instructors */}
                </Typography>
              </Grid>
            </Grid>
            <Box className="flex items-center mt-4">
              <Button variant="contained" color="primary" className="rounded-full px-4 mr-3" component="a" href="https://sites.google.com/view/worldskills-fair/home" target="_blank" rel="noopener noreferrer">
                Read More
              </Button>
              <Button variant="contained" color="primary" className="rounded-full px-4 mr-3" component="a" href="https://worldskills.org/" target="_blank" rel="noopener noreferrer">
                Visit Worldskills
              </Button>
            </Box>
          </Grid>
        </Grid>
      </Container>
      {/* About End */}

      {/* Artists Section */}
      <Container className="py-5">
        <Grid container spacing={5} justifyContent="center">
          <Grid item lg={5} xs={12}>
            <Box className="relative overflow-hidden mb-8">
              <img src="img/worldskill/Untitled design (1).png" alt="Worldskill 1" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Speech</Typography>
              </Box>
            </Box>
            <Box className="relative overflow-hidden mb-8">
              <img src="img/worldskill/DeKUT-team-after-the-Closing-Ceremony.png" alt="Worldskills Participants" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Worldskills Participants and the Instructors</Typography>
              </Box>
            </Box>
            <Box className="relative overflow-hidden">
              <img src="img/worldskill/pic1.png" alt="Worldskills" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Worldskills Participants and the Instructors</Typography>
              </Box>
            </Box>
          </Grid>
          <Grid item lg={5} xs={12}>
            <Box className="relative overflow-hidden mb-8">
              <img src="img/worldskill/Pic.png" alt="Worldskills Participants 1" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Worldskills participants 1</Typography>
              </Box>
            </Box>
            <Box className="relative overflow-hidden mb-8">
              <img src="img/worldskill/Pic2.png" alt="Worldskills Participants" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Worldskills participants</Typography>
              </Box>
            </Box>
            <Box className="relative overflow-hidden">
              <img src="img/worldskill/Untitled design.png" alt="Jean Bosco Addressing Participants" className="w-full rounded-lg" />
              <Box className="absolute inset-0 bg-primary bg-opacity-75 backdrop-blur-lg flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity duration-500">
                <Typography variant="body1" className="text-light">Prof Eng. Jean Bosco Addressing the participants</Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </Container>

      {/* Services Section */}
      <Container className="bg-light mt-5 py-5">
        <Grid container spacing={5} alignItems="center">
          <Grid item lg={12}>
            <Grid container spacing={4}>
              {/* {services.map((service, index) => ( */}
                <Grid item md={3} key={index}>
                  <Box className="flex flex-col items-center text-center rounded-lg p-4 bg-white shadow-md hover:shadow-lg transition-shadow duration-300">
                    <Box className="bg-primary text-white p-2 rounded-full mb-3">
                      /{service.icon}
                    </Box>
                    <Typography variant="h5" className="mb-3">{service.title}</Typography>
                    <Typography className="mb-3">{service.description}</Typography>
                    <Button variant="contained" color="primary" href={service.link}>
                      Read More
                    </Button>
                  </Box>
                </Grid>
              {/* ))} */}
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default MainContent;
